  const [id, setId] = useState('test');
  const [content, setContent] = useState('This is a test notification');
  const [variant, setVariant] = useState(options[0]);
  const [autoDismiss, setAutoDismiss] = useState(false);
  return <Padbox paddingSize="lg">
      <Stack gap="md">
        <Label>Id:</Label>
        <Input value={id} onChange={e => setId(e.target.value)} />
        <Label>Content:</Label>
        <Input value={content} onChange={e => setContent(e.target.value)} />
        <Label>Type:</Label>

        {/* eslint-disable-next-line @typescript-eslint/ban-ts-comment */}
        {/* @ts-ignore */}
        <Select options={options} value={variant} onChange={setVariant} />
        <Label>Autodismiss:</Label>
        <Checkbox checkboxId="autoDismiss" checked={autoDismiss === true} name="autoDismiss" onChange={e => setAutoDismiss(e.target.checked)} />
        <Inline gap="md">
          <Button onClick={() => addNotification({
          id,
          variant: variant.value,
          content,
          autoDismiss
        })}>
            Add notification
          </Button>
          <Button onClick={() => updateNotification({
          id,
          variant: variant.value,
          content,
          autoDismiss
        })}>
            Update notification
          </Button>
          <Button onClick={() => removeNotification(id)}>
            Remove notification
          </Button>
        </Inline>
      </Stack>
    </Padbox>;
